import styled from 'styled-components';

export default styled.div`
    height: 100%;
    width: 100%;
    box-shadow: 0 1px 7px 0 rgba(0, 0, 0, 0.15);

    &.aqua { background: #00FFFF; }

    &.simple { background: #B0C4DE; }

    &.darkyan { background: #008B8B }

`;
